import React, { Component } from 'react';
import {withRouter} from 'react-router-dom';
import './Notification.css';
class Notifcation extends Component{

render(){
  return(
   <div className='notification'>
    <table id="customers">
                    <tbody>
                        <tr>
                            <th>ID</th>
                            <th>Username</th>
                            <th>Phone</th>
                            <th>StartDate</th>
                            <th>EndDate</th>
                            <th>Action</th>

                        </tr>
                        {items.map(item => {
                            return (
                                <tr>
                                    <td contenteditable="true"> {item.id}</td>
                                    <td contenteditable="true">{item.username}</td>

                                    <td contenteditable="true">{item.phone}</td>
                                    <td contenteditable="true">{item.startDate}</td>
                                    <td contenteditable="true">{item.endDate}</td>
                                    <td contenteditable="false">{item.action}
                                    <button onClick={this.props.handelDelete.bind(null,item)}>Delete</button>
                                   
                                    </td>
                                    
                                </tr>
                            );
                        })}
                    </tbody>
                </table>
    
     
   </div>
    
    
  )
}

}
export default withRouter(Notifcation) ;
